import { UncontrolledCarousel } from 'reactstrap';
import './Carousel.css';



const items = [
  {
    src: '/images/join.jpg' ,
    altText: 'Events',
    caption: 'Join with a Venue',
    header: 'Events ',
    key: '1' 
    
  },
  {
    src:'/images/explore.jpg',
    altText: 'Slide 2',
    caption: 'Reunite with a Loved One',
    header: 'Slide 2 Header',
    key: '2'
  },
  {
    src: '/images/connect.jpg',
    altText: 'Slide 3',
    caption: 'Plan an event',
    header: 'Slid',
    key: '3'
  }
];

const Example = () => <UncontrolledCarousel items={items} />;




